import React from 'react';
import Header from './components/Header';

function App() {

  const saludo = "Buen día Mundo ♥"
  const edad = 18
  let mensaje;
  if (edad >= 18) {
    mensaje = "Eres mayor de edad"

  } else {
    mensaje = "No eres mayor de edad"
  }


  return (
    <div className="App">
      <h1>Básicos React</h1>
      <h2>{saludo}</h2>
      <h2>{mensaje}</h2>

      <Header/>
    </div>
  );
}

export default App;
